дпресов коментатор','Responses to %s'=>'Реаговања на','Response to %s'=>'Одговор на %s','block titleComment Date'=>'Датум коментара','block titleComment Content'=>'Садржај коментара','Default Avatar'=>'Подразумевани аватар','There is already a ping from that URL for this post.'=>'Већ постоји пинг са те URL адресе за овај чланак.','The password cannot be a space or all spaces.'=>'Лозинка не може бити размак или сви размаци.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'Потребна вам је додатна помоћ? <a href="%1$s">Прочитајте чланак за подршку на %2$s</a>.','The database server could be connected to (which means your username and password is okay) but the %s database could not be selected.'=>'Сервер базе података може бити повезан (што значи да је ваше корисничко име и лозинка у реду), али база података %s не може бити одабрана.','Cannot select database'=>'Није могуће одабрати базу података','That file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Датотека није пронађена. Провери <a href="%s">media library</a> и види да није обрисана.','Sorry, the video at the supplied URL cannot be loaded. Please check that the URL is for a supported video file (%s) or stream (e.g. YouTube and Vimeo).'=>'Жао нам је, не можемо да учитамо видео запис на наведеном URL-у. Молимо вас да проверите да ли је URL за подржану датотеку видео записа (%s) или ток (Јутјуб или Вимео).','That video cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Не можемо да пронађемо тај видео запис. Проверите своју <a href="%s">библиотеку садржаја</a> и будите сигурни да није обрисан.','That image cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Не можемо да пронађемо ту слику. Проверите своју <a href="%s">библиотеку садржаја</a> и будите сигурни да није обрисана.','That audio file cannot be found. Check your <a href="%s">media library</a> and make sure it was not deleted.'=>'Не можемо да пронађемо ту датотеку звучног записа. Проверите своју <a href="%s">библиотеку садржаја</a> и будите сигурни да није обрисана.','User URL may not be longer than 100 characters.'=>'Корисничка УРЛ адреса не може бити дужа од 100 знакова.','Unable to pass %s if not using multisite.'=>'Није могуће пренети %s ако се не користи мрежа сајтова.','Webfont font weight must be a properly formatted string or integer.'=>'Тежина фонтова на вебу мора бити исправно форматирана низа или цео број.','Each webfont src must be a non-empty string.'=>'Сваки извор веб фонтова мора бити непразан низ карактера.','Webfont src must be a non-empty string or an array of strings.'=>'Webfont src мора бити празан низ или низ низова.','Webfont font family must be a non-empty string.'=>'Webfont font family мора бити непразан низ.','Limit results to those matching a pattern (slug).'=>'Ограничи резултате на оне који се подударају са мустром (подложаком).','Ancestor blocks.'=>'Предак блокова.','Determines whether the pattern is visible in inserter.'=>'Одређује да ли је мустра видљива у уметачу.','The pattern keywords.'=>'Кључне речи мустре.','The pattern category slugs.'=>'Подложци категорија мустри.','Block types that the pattern is intended to be used with.'=>'Типови блокова за које је мустра намењена.','The pattern viewport width for inserter preview.'=>'Ширина мустре погледа за преглед уметача.','The pattern detailed description.'=>'Детаљни опис мустре.','The pattern name.'=>'Име мустре.','Sorry, you are not allowed to view the registered block patterns.'=>'Жао нам је, није вам дозвољено да погледате регистроване мустре блокова.','The category label, in human readable format.'=>'Етикета категорије, у облику разумљивом за људе.','The category name.'=>'Назив категорије.','Sorry, you are not allowed to view the registered block pattern categories.'=>'Жао нам је, није вам дозвољено да погледате регистроване категорије мустри блокова.','Error in deleting the attachment.'=>'Грешка у брисању прилога.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>Грешка:</strong> Ово није исправан шаблон за довод.','unit symbolPB'=>'PB','unit symbolEB'=>'EB','unit symbolZB'=>'ZB','unit symbolYB'=>'YB','The description will be displayed in the menu if the active theme supports it.'=>'Опис ће бити приказан у изборнику ако га тренутна тема подржава.','A title on that page cannot be found.'=>'Наслов на тој страни није пронађен','color schemeLight'=>'Светла','color schemeDark'=>'Тамна','<strong>Error:</strong> The themes directory is either empty or does not exist. Please check your installation.'=>'<strong>Грешка:</strong> Директоријум са темама је празан или не постоји. Молим вас проверите вашу инсталацију.','File does not exist?'=>'Датотека не постоји?','Adding an RSS feed to this site’s homepage is not supported, as it could lead to a loop that slows down your site. Try using another block, like the <strong>Latest Posts</strong> block, to list posts from the site.'=>'Додавање RSS довода на почетну страницу овог сајта није подржано, јер може довести до петље која успорава ваш сајт. Покушајте користити други блок, као што је блок <strong>Најновији чланци</strong>, да бисте навели чланке са сајта.','Responses'=>'Одговори','Response'=>'Одговор','Older Comments'=>'Старији коментари','Newer Comments'=>'Новији коментари','(%s website link, opens in a new tab)'=>'(Веза ка %s веб месту, отвара се у новом језичку)','(%s author archive, opens in a new tab)'=>'(%s архива аутора, отвара се у новом језичку)','%s Avatar'=>'%s аватар','Could not register file "%s" as a block pattern ("Title" field missing)'=>'Није могуће регистровати датотеку "%s" као мустру блока (недостаје поље "Наслов")','Could not register file "%1$s" as a block pattern (invalid slug "%2$s")'=>'Није могуће регистровати датотеку "%1$s" као блок мустру (неисправан подложак "%2$s")','Could not register file "%s" as a block pattern ("Slug" field missing)'=>'Није могуће регистровати датотеку "%s" као блок мустру (поље "Подложак" недостаје).','Block pattern categoryFeatured'=>'Издвојено','Use Site Editor'=>'Користите визуелни уређивач','Hurray! Your theme supports site editing with blocks. <a href="%1$s">Tell me more</a>. %2$s'=>'Ура! Ваша тема подржава комплетно уређивање сајта са блоковима. <a href="%1$s">Додатне информације</a>. %2$s','Site icon.'=>'Иконица сајта','block descriptionDisplay the description of categories, tags and custom taxonomies when viewing an archive.'=>'Приказ описа категорија, ознака и таксономија приликом прегледа архиве.','block titleTerm Description'=>'Опис појма','block descriptionEdit the different global regions of your site, like the header, footer, sidebar, or create your own.'=>'Направите измену друге секције вашег сајта, попут заглавља, подножија, бочне траке, или креирајте нову.','block titleTemplate Part'=>'део шаблона','block descriptionCreate structured content in rows and columns to display information.'=>'Направите структурирани садржај у редовима и колонама за приказ информација.','block descriptionDisplays the name of this site. Update the block, and the changes apply everywhere it’s used. This will also appear in the browser title bar and in search results.'=>'Прикажи назив овог сајта. Ажурирањем овог блока, измене ће бити примењене свуда где се користи. Такође, биће приказан и у наслову претраживача и у резултатима претраге.','block style labelPlain'=>'Проста','block titlePagination'=>'По страни','block titlePrevious Page'=>'Претходна страна','block titlePage Numbers'=>'Бројеви страна','block titleNext Page'=>'Следећа страна','block descriptionDisplays the next or previous post link that is adjacent to the current post.'=>'Приказује следећу или претходну везу чланка која је суседна тренутном чланку.','block titlePost Navigation Link'=>'Веза навигације чланка','block descriptionDisplay a post\'s comments form.'=>'Приказати образац коментара чланка.','block titleComments Form'=>'Образац за коментаре','block descriptionShow a block pattern.'=>'Приказати мустру блока.','block titlePattern'=>'Мустра','block descriptionA collection of blocks that allow visitors to get around your site.'=>'Збирка блокова који омогућавају посетиоцима да се крећу по вашем сајту.','block titleNavigation'=>'Навигација','block descriptionAdd a submenu to your navigation.'=>'Додај подизборник у своју навигацију.','block titleSubmenu'=>'Подизборник','block descriptionAdd a page, link, or another item to your navigation.'=>'Додајте страницу, везу или другу ставку у вашу навигацију.','block titleCustom Link'=>'Прилагођенa везa','block descriptionDisplay content in multiple columns, with blocks added to each column.'=>'Прикажи садржај у више колона, са блоковима додатим у сваку колону.','No comments'=>'Нема коментара','Confirm'=>'Потврди','Could not strip invalid text.'=>'Није могуће уклонити неисправан текст.','Could not retrieve table charset.'=>'Није могуће добити сет карактера.','WordPress database error: Processing the values for the following fields failed: %s. The supplied values may be too long or contain invalid data.'=>'Грешка базе података WordPress: Обрада вредности за следећа поља није успела: %s. Предате вредности су можда предуге или можда садрже неисправне податке.','WordPress database error: Processing the value for the following field failed: %s. The supplied value may be too long or contains invalid data.'=>'Грешка базе података Вордпреса: Неуспешно обрађивање вредности за следеће поље: %s. Представљена вредност је можда предуга или садржи неисправне податке.','WordPress database error: Could not perform query because it contains invalid data.'=>'Грешка базе података Вордпреса: Није могуће извршити упит јер садржи неисправне податке.','"%1$s" style should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'%1$s" стил не треба бити учитан заједно са новим уређивачем виџета (%2$s или %3$s).','"%1$s" script should not be enqueued together with the new widgets editor (%2$s or %3$s).'=>'Скрипта "%1$s" не треба бити учитана заједно са новим уређивачем виџета (%2$s или %3$s).','The description is not prominent by default; however, some themes may show it.'=>'Опис није подразумевано истакнут; ипак, неке теме га могу приказати.','Assign a parent term to create a hierarchy. The term Jazz, for example, would be the parent of Bebop and Big Band.'=>'Доделите надређеног члана да бисте направили хијерархију. Члан Џез, на пример, био би надређен Би-бапу и Биг бенду.','The &#8220;slug&#8221; is the URL-friendly version of the name. It is usually all lowercase and contains only letters, numbers, and hyphens.'=>'&#0132;Подложак&#0147; је пријатељско издање URL-а имена. Обично је написано са свим малим словима и садржи само слова, бројеве и цртице.','The name is how it appears on your site.'=>'Име је оно како се појављује на вашем веб месту.','Template Part Area'=>'Простор дела шаблона','Template Part Areas'=>'Простори делова шаблона','The server cannot process the image. This can happen if the server is busy or does not have enough resources to complete the task. Uploading a smaller image may help. Suggested maximum size is 2560 pixels.'=>'Сервер не може обрадити слику. Ово може да се деси ако је сервер заузет или нема довољно ресурса да заврши задатак. Отпремање мање слике може помоћи. Предложена највећа величина је 2560 пиксела.','Limit result set to users who have published posts.'=>'Ограничи скуп резултата на кориснике који су објавили чланке.','Limit result set to users matching at least one specific capability provided. Accepts csv list or single capability.'=>'Ограничи скуп резултата на кориснике који одговарају бар једном конкретном способношћу. Прихвата списак способности раздвојен зарезима или појединачну способност.','Sorry, you are not allowed to filter users by capability.'=>'Жао нам је, није вам дозвољено да филтрирате кориснике по способности.','Unable to retrieve body from response at this URL.'=>'Није могуће добити тело одговора са овог URL-а.','URL not found. Response returned a non-200 status code for this URL.'=>'URL није пронађен. Одговор је вратио стање које није 200 за овај URL.','Sorry, you are not allowed to process remote URLs.'=>'Жао нам је, није вам дозвољено да обрађујете удаљене URL-ове.','Invalid URL'=>'Неисправан URL','The Open Graph image link of the %1$s or %2$s element from the URL.'=>'Веза слике Open Graph елемента %1$s или %2$s са URL-а.','The content of the %s element from the URL.'=>'Садржај елемента %s из URL-а.','The favicon image link of the %s element from the URL.'=>'Веза слике фавикона елемента %s са URL-ом.','The contents of the %s element from the URL.'=>'Садржај елемента %s из URL-а.','The URL to process.'=>'URL за обраду.','Where the template part is intended for use (header, footer, etc.)'=>'Где је део шаблона намењен за коришћење (заглавље, подножје, итд.)','Whether a template is a custom template.'=>'Да ли је шаблон прилагођен шаблон.','The ID for the author of the template.'=>'ID за аутора шаблона.','HTML title for the template, transformed for display.'=>'HTML наслов за шаблон, претворен за приказ.','Title for the template, as it exists in the database.'=>'Наслов за шаблон, какав у бази података.','Version of the content block format used by the template.'=>'Издање облика блока садржаја који користи шаблон.','Content for the template, as it exists in the database.'=>'Садржај за шаблон, какав је у бази података.','Source of a customized template'=>'Извор прилагођеног шаблона','Type of template.'=>'Врста шаблона.','Post type to get the templates for.'=>'Врста чланка за коју ћете добити шаблоне.','Limit to the specified template part area.'=>'Ограничи на одређени простор дела шаблона.','REST namespace route for the taxonomy.'=>'REST простор имена за таксономију.','Whether to make the post type available for selection in navigation menus.'=>'Да ли да омогућимо доступност врсте чланка за одабир у изборницима навигације.','Whether to generate a default UI for managing this post type.'=>'Да ли да генеришемо уобичајени кориснички интерфејс за управљање овом врстом чланка.','The visibility settings for the post type.'=>'Подешавања видљивости за врсту чланка.','REST route\'s namespace for the post type.'=>'Простор имена REST-а за врсту чланка.','Whether to automatically add top level pages to this menu.'=>'Да ли да аутоматски додате странице на врху нивоа у овај изборник.','The locations assigned to the menu.'=>'Локације додељене изборнику.','The menu cannot be deleted.'=>'Изабраник не може бити обрисан.','Menus do not support trashing. Set \'%s\' to delete.'=>'Изборници не подржавају премештање у отпад. Поставите \'%s\' да се избрише.','Sorry, you are not allowed to view menus.'=>'Жао нам је, није вам дозвољено да погледате изборнике.','The ID of the assigned menu.'=>'ID додељеног изборника.','The description of the menu location.'=>'Опис локације изборника.','The name of the menu location.'=>'Име локације изборника.','Invalid menu location.'=>'Неисправна локација изборника.','Sorry, you are not allowed to view menu locations.'=>'Жао нам је, није вам дозвољено да видите локације изборника.','An alphanumeric identifier for the menu location.'=>'Алфанумерички идентификатор за локацију изборника.','The terms assigned to the object in the %s taxonomy.'=>'Чланови додељени предмету у таксономији %s.','Whether the menu item represents an object that no longer exists.'=>'Да ли изборник ставка представља објекат који више не постоји.','The XFN relationship expressed in the link of this menu item.'=>'XFN веза изражена у вези ове ставке изборника.','The URL to which this menu item points.'=>'URL на који ова ставка изборника показује.','The singular label used to describe this type of menu item.'=>'Једноставна етикета која се користи за опис ове врсте изборника.','The target attribute of the link element for this menu item.'=>'Циљни атрибут елемента везе за ову ставку изборника.','The database ID of the original object this menu item represents, for example the ID for posts or the term_id for categories.'=>'ID базе података оригиналног објекта који ова ставка изборника представља, на пример ID за чланке или term_id за категорије.','The type of object originally represented, such as "category", "post", or "attachment".'=>'Врста објекта који је првобитно представљен, као што су "категорија", "чланак" или "прилог".','The DB ID of the nav_menu_item that is this item\'s menu parent, if any, otherwise 0.'=>'DB ID изборника навигационе ставке који је родитељ ове ставке, ако постоји, у супротном 0.','The description of this menu item.'=>'Опис ове ставке изборника.','Class names for the link element of this menu item.'=>'Класни називи за елемент везе ове ставке изборника.','Text for the title attribute of the link element for this menu item.'=>'Текст за насловни атрибут елемента везе за ову ставку изборника.','The ID for the parent of the object.'=>'ID родитеља предмета.','A named status for the object.'=>'Именовано стање предмета.','The family of objects originally represented, such as "post_type" or "taxonomy".'=>'Породица објеката које су првобитно представљене, као што су "post_type" или "taxonomy".','HTML title for the object, transformed for display.'=>'HTML наслов предмета, претворен за приказ.','Title for the object, as it exists in the database.'=>'Наслов предмета, као што постоји у бази података.','Get linked object.'=>'Добијте повезани објекат.','The url is required when using a custom menu item type.'=>'URL је обавезан приликом коришћења приилагођеног типа ставке изборника.','The title is required when using a custom menu item type.'=>'Наслов је обавезан при коришћењу прилагођеног типа ставке изборника.','Menu items do not support trashing. Set \'%s\' to delete.'=>'Ставке изборника не подржавају премештање у отпад. Поставите \'%s\' да брише.','Sorry, you are not allowed to access the global styles on this site.'=>'Жао нам је, није ва